import React from "react";
import {
  VictoryBar,
  VictoryChart,
  VictoryAxis,
  VictoryTheme,
  VictoryStack,
  VictoryPolarAxis,
} from "victory";

const Graph = (props) => {
  return (
    <VictoryChart polar theme={VictoryTheme.material}>
      {["cat", "dog", "bird", "dog", "frog", "fish"].map((d, i) => {
        return (
          <VictoryPolarAxis
            dependentAxis
            startAngle={0}
            endAngle={180}
            key={i}
            label={d}
            labelPlacement="perpendicular"
            style={{ tickLabels: { fill: "none" } }}
            axisValue={d}
          />
        );
      })}
      <VictoryBar
        style={{ data: { fill: "tomato", width: 25 } }}
        data={[
          { x: "cat", y: 10 },
          { x: "dog", y: 25 },
          { x: "bird", y: 40 },
          { x: "frog", y: 50 },
          { x: "fish", y: 50 },
        ]}
      />
    </VictoryChart>
  );
};
export default Graph;
